webpackJsonp([0xf1a33c90cce3],{326:function(e,o){e.exports={data:{markdownRemark:{html:'<h4>What was covered during this Meetup:</h4>\n<ul>\n<li>Welcome to our first Meetup! Meet &#x26; Greet. Intro to coding. OOP.</li>\n<li>The Mission &#x26; Vision of this group - by Nick Kolev</li>\n<li>What is a RESTful API?</li>\n<li>Opinion: "Why I chose React &#x26; React Native"</li>\n<li>Design Patterns: MVC, Observer, Singleton</li>\n<li>AI/ML Prototype Showcase built on Microsoft Azure\'s APIs - by Nick Kolev and Michael Witt - we ran out of time :(</li>\n<li>Next Steps</li>\n</ul>\n<h3>The presentation</h3>\n<iframe src="https://docs.google.com/presentation/d/e/2PACX-1vTFSbmx6hi9cj4X-f8iGL55Wziz8dN7086cr24rLYJVeuYct49tikrGPapd4t-u_97CZ5-4KmP5T5WL/embed?start=true&loop=false&delayms=5000" frameborder="0" width="960" height="569" allowfullscreen="true" mozallowfullscreen="true" webkitallowfullscreen="true"></iframe>\n<h4>What can be coded?</h4>\n<ul>\n<li>Websites &#x26; Web Apps (Web)</li>\n<li>Mobile Apps  (IOS, Android, Windows)</li>\n<li>Augmented Reality / Virtual Reality (AR / VR)</li>\n<li>Artificial Intelligence / Machine Learning (AI / ML)</li>\n<li>Desktop Applications (Windows, OS X, Linux)</li>\n<li>Internet of Things (IoT)</li>\n</ul>\n<h4>Web Development Technologies</h4>\n<ul>\n<li>\n<p><code>Frontend</code>: HTML5, CSS3, Javascript</p>\n</li>\n<li>\n<p><code>Backend</code>: Node, PHP, Java, C#, Ruby, Python, etc.</p>\n</li>\n<li>\n<p><code>Frameworks</code>: Express (Node), Laravel (PHP), .NET (C#), Rails (Ruby), Django (Python), etc.</p>\n</li>\n<li>\n<p><code>Databases</code>: MySQL, PostgreSQL, Oracle, MSSQL, MongoDB, CouchDB, DynamoDB, etc.</p>\n</li>\n<li>\n<p><code>Tools &#x26; More</code>: Webpack, Babel, Gulp, Docker, etc.</p>\n</li>\n<li>\n<p><code>HTML</code> is for the structure of a webpage.</p>\n</li>\n<li>\n<p><code>CSS</code> is for the look and feel of a webpage.</p>\n</li>\n<li>\n<p><code>Javascript</code> is for the software behavior of a webpage.</p>\n</li>\n</ul>\n<h3>Mobile App Development</h3>\n<ul>\n<li>\n<p><code>Android</code>: Java, Kotlin; Android Studio</p>\n</li>\n<li>\n<p><code>IOS</code>: Swift, Objective-C; Xcode</p>\n</li>\n<li>\n<p><code>Windows</code>: .NET (C#)</p>\n</li>\n<li>\n<p><code>Cross Platform</code>: React Native, PhoneGap, Xamarin, Flutter, etc.</p>\n</li>\n<li>\n<p><code>Native vs Hybrid</code></p>\n</li>\n<li>\n<p><code>Opinion</code>: Why React Native?</p>\n</li>\n</ul>\n<h3>Various Concepts &#x26; Design Patterns</h3>\n<ul>\n<li><code>MVC</code>, Observer, Singleton Design Patterns</li>\n<li><code>OOP</code>: Object Oriented Programming</li>\n<li><code>CMS</code>: Content Management System; Wordpress, Joomla, Drupal</li>\n<li><code>HTTP</code>: Hypertext Transfer Protocol</li>\n<li><code>Git</code>: Version Control System; Github, Bitbucket</li>\n<li><code>API</code>: Application Programming Interface; REST, SOAP  </li>\n<li><code>SPA</code>: Single-Page Application; React, Angular</li>\n</ul>\n<h3>Workshop Ideas</h3>\n<ul>\n<li><code>Javascript edge cases</code>  - Live Coding</li>\n<li><code>Intro to Node</code> - Live Coding</li>\n<li><code>Intro to React</code> - Live Coding</li>\n<li><code>Artificial Intelligence Theory</code> - Skype session with a Data Scientist</li>\n<li><code>Designing a Web page with Bootstrap 4</code> - Live Coding</li>\n<li><code>Practicing for a Web Developer interview</code> - Presentation, Q &#x26; A with a Senior   Recruiter</li>\n<li><code>Intro to SQL and Databases</code> - Presentation, Live Coding</li>\n</ul>\n<h3>Where &#x26; How to Learn</h3>\n<ul>\n<li>Youtube, <code>Udemy</code> (~$10/course), <code>Lynda.com</code>, <code>EdX</code></li>\n<li>Your <code>local library</code> (some branches also provide free Lynda.com access ^_^)</li>\n<li>Computer Science Fundamentals (<code>Harvards’ CS50</code>)  </li>\n<li>Code every day, at least for 1 - 2 hours</li>\n<li>Work for FREE</li>\n<li>Offer your friends to make a website for them for free and <code>build a portfolio</code></li>\n<li>Don’t be embarrassed! <code>Share your code on Github</code> (it landed me a job)</li>\n</ul>\n<p>To learn more about the group and be notified about future meetings, please join our Meetup group:  <a href="https://www.meetup.com/lacoders/" target="_blank">https://www.meetup.com/lacoders/</a>.  </p>',frontmatter:{title:"Fundamental concepts in software development | Summary of May 22nd's Meetup @ WeWork Burbank",author:"Argi Avetisyan",date:"27 May, 2018"}}},pathContext:{slug:"/2018-05-27-software-development-fundamentals-summary-of-meetup-event/"}}}});
